import React from 'react'
import {Link} from 'react-router-dom'

function Library() {
    return (
      <section className="body-font">
        <div>
          <h1 className="text-center text-black-900 font-large body-font text-5xl" >Library World</h1>

        </div>
        <div>
          <h1 className="text-center text-black-900 font-medium text-2xl">Search Books You Want</h1>
        </div>
      </section>

    )
}

export default Library;
